import React from "react";
import '../assets/css/TagTwoBtn.css';
//import classNames from 'classnames';
class TagTwoBtn extends React.Component {
  state={
    isActive:false,
  }
  changeTag(){
    this.setState({isActive:!this.state.isActive});
  }
  render() {

    return (
      <div className={TagTwoBtn}>
         {this.props.title}
      </div>
    );
  }
}

export default TagTwoBtn;
